  })

    const arr = Array.from(map);
    console.log(arr);

    const arrOfObj  = arr.map(([key, value]) => {
        return {[key]: value};
    });

  return (
      <div style={{ height: 400, width: '100%' }}>
        <DataGrid
            rows={arrOfObj}
            columns={columns}
            pageSize={5}
            rowsPerPageOptions={[5]}
            checkboxSelection
